  `app_status` smallint(6) unsigned NOT NULL DEFAULT '0' COMMENT '0:Draft 草稿 5:Pending for API Uploaded API待上传 9:Pending for File Uploaded 文件待上传 2:API Uploading API上传中 7:File Uploading 文件上传中 8:Upload Failed 上传失败 1:Online 在线 6:Updated 待更新 4:Canceled 已删除 3:Pause 暂停  10:Variation Draft 15:Variation API Upload 16:Variation API Uploading 12:Variation Online 17:Variation Upload Failed 14:Cancel Variation 18:Variation File Upload 19:Variation File Uploading 20:Variation Update 21:Variation Update Failed 22:Copied Listing 拷贝的广告列表'' 23：Variation Copied Listing 29:单品Error人工维护 30：单品Error系统维护 31：Variation Error人工维护 32：Variation Error系统维护',
  `history_status` smallint(6) NOT NULL DEFAULT '-1' COMMENT '历史状态',
