  `create_user_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '创建人',
  `upload_time` datetime DEFAULT NULL COMMENT '上传时间',
  `added_time` datetime DEFAULT NULL COMMENT '上架时间',
  `is_update_failure` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否更新失败:1成功,2失败',
  `is_prohibited` enum('N','Y') NOT NULL DEFAULT 'N' COMMENT '是否包含可保存违禁词',
  `updata_number` smallint(6) NOT NULL DEFAULT '0' COMMENT '系统移动广告的次数',
  `prohibited_words` varchar(255) NOT NULL DEFAULT '' COMMENT '包含的违禁词',
