/*Table structure for table `amazon_advt_detail` */

DROP TABLE IF EXISTS `amazon_advt_detail`;

CREATE TABLE `amazon_advt_detail` (
  `aad_id` int(10) unsigned NOT NULL,
  `aap_id` int(10) unsigned NOT NULL COMMENT '分站点广告属性表ID',
  `ac_id` int(11) NOT NULL COMMENT 'amazon_config表ac_id，站点ID',
  `product_id` varchar(25) DEFAULT NULL COMMENT 'variation广告产品ID',
  `attribute_param` varchar(50) NOT NULL COMMENT '属性名称',
  `attribute_value` varchar(4000) NOT NULL COMMENT '属性值',
  `is_variation` enum('N','Y') DEFAULT 'N' COMMENT '是否是Variation广告',
  `is_parents` smallint(6) DEFAULT '2' COMMENT '1.母SKU，2.子SKU',
  PRIMARY KEY (`aad_id`),
  KEY `aap_id` (`aap_id`) USING BTREE,
  KEY `product_id` (`product_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='亚马逊产品上传参数详细表';

