/*Table structure for table `amazon_advt_upc` */

DROP TABLE IF EXISTS `amazon_advt_upc`;

CREATE TABLE `amazon_advt_upc` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `advt_id` int(11) NOT NULL DEFAULT '0' COMMENT '广告id',
  `advt_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '广告类型(1:单品 2:variation)',
  `type` tinyint(1) NOT NULL DEFAULT '1' COMMENT '1.upc,2.ean',
  `upc` varchar(15) NOT NULL COMMENT '亚马逊upc/ean',
  `product_id` int(11) DEFAULT '0' COMMENT '产品id',
  `ac_id` smallint(6) NOT NULL COMMENT '站点ID',
  `last_update` datetime DEFAULT NULL COMMENT '更新时间',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `upc` (`upc`),
  KEY `advt_type_advt_product_ac_id` (`advt_type`,`advt_id`,`product_id`,`ac_id`),
  KEY `product_id` (`product_id`)
) ENGINE=InnoDB AUTO_INCREMENT=9892 DEFAULT CHARSET=utf8 COMMENT='亚马逊广告upc表';

