/*Table structure for table `amazon_category` */

DROP TABLE IF EXISTS `amazon_category`;

CREATE TABLE `amazon_category` (
  `ac_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '亚马逊目录表自增ID',
  `amazon_site` varchar(20) DEFAULT NULL COMMENT '站点',
  `category_classification` varchar(100) DEFAULT NULL,
  `amazon_category_id` bigint(15) DEFAULT NULL COMMENT '亚马逊目录ID',
  `amazon_category_name` varchar(200) DEFAULT NULL COMMENT '亚马逊目录名称',
  `amazon_category_name_path` varchar(1000) DEFAULT NULL,
  `template_type` varchar(100) DEFAULT NULL COMMENT '模版名称',
  `amazon_category_parent_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '亚马逊父目录ID',
  `category_level` tinyint(4) NOT NULL DEFAULT '0' COMMENT '目录级别',
  `last_update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后更新时间',
  `amazon_config_id` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`ac_id`),
  KEY `amazon_site` (`amazon_site`,`amazon_category_id`),
  KEY `ac_id` (`amazon_config_id`)
) ENGINE=InnoDB AUTO_INCREMENT=681554 DEFAULT CHARSET=utf8 COMMENT='Amazon目录表';

