/*Table structure for table `amazon_config` */

DROP TABLE IF EXISTS `amazon_config`;

CREATE TABLE `amazon_config` (
  `ac_id` int(11) NOT NULL,
  `site_code` varchar(25) NOT NULL DEFAULT '' COMMENT '站点',
  `commission` decimal(5,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '佣金',
  `gross_margin` decimal(5,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '毛利率',
  `smart_gross_margin_max` decimal(5,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '智能价毛利率上限',
  `smart_gross_margin_min` decimal(5,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '智能价毛利率下限',
  `smart_gross_margin_range` decimal(5,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '智能价毛利率变动幅度',
  `vat_tax_rate` decimal(5,2) unsigned NOT NULL DEFAULT '0.00' COMMENT 'VAT比例',
  `vat_threshold` decimal(8,2) unsigned NOT NULL DEFAULT '0.00' COMMENT 'VAT起征点',
  `vat_real_threshold` decimal(8,2) unsigned NOT NULL DEFAULT '0.00' COMMENT 'VAT实际起征点',
  `currency_code` char(3) NOT NULL DEFAULT '' COMMENT '定价币种',
  `country_code` char(2) NOT NULL DEFAULT '' COMMENT '国家编码',
  `language_id` tinyint(4) NOT NULL DEFAULT '0' COMMENT '语言ID',
  `is_basic_site` enum('Y','N') NOT NULL DEFAULT 'Y' COMMENT '是否是基本站点，Y：是基本站点, N:扩展站点',
  `is_priority_selling` enum('Y','N') NOT NULL DEFAULT 'N' COMMENT '是否优先跟卖降价Y：优先。N：不优先',
  `sku_prefix` varchar(8) NOT NULL DEFAULT '' COMMENT 'SKU前缀',
  `sku_suffix` varchar(12) NOT NULL DEFAULT '' COMMENT 'SKU后缀',
  `update_time` datetime DEFAULT NULL COMMENT '最后更新时间',
  `company` varchar(20) NOT NULL DEFAULT '' COMMENT '公司',
  `account` varchar(20) NOT NULL DEFAULT '' COMMENT '账号',
  `merchant_alias` varchar(16) NOT NULL DEFAULT '' COMMENT '账号别名',
  `manage_area` varchar(20) NOT NULL DEFAULT '' COMMENT '账号管理地区',
  `is_holiday_mail` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '是否自动回复假日邮件,1:是;0:否',
  `is_need_brand` enum('Y','N') NOT NULL DEFAULT 'N' COMMENT '是否使用品牌，Y默认使用，N不使用',
  `is_open_smart_gross_margin` enum('Y','N') NOT NULL DEFAULT 'N' COMMENT '是否开启智能毛利率，Y：开启。N：不开启',
  `is_open_list_price` enum('N','Y') NOT NULL DEFAULT 'N' COMMENT '是否开启促销价（设置List Price和真实Price）',
  `list_price_multiple` varchar(11) NOT NULL DEFAULT '1.8' COMMENT '促销价为初始价格的多少倍',
  `fba_whid` int(11) NOT NULL DEFAULT '0' COMMENT 'fba仓库id',
  `shop_code` varchar(25) DEFAULT '' COMMENT '店铺编码',
  `product_line` varchar(255) DEFAULT '' COMMENT '允许上传广告的产品线',
  `brand_config` varchar(2000) NOT NULL DEFAULT '' COMMENT '品牌配置',
  `is_advt_hidden` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否隐藏创建广告：0：不隐藏，1：隐藏',
  `advt_upload_status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '广告上传状态：0：正常上传，1：暂停，2：延迟上传',
  `invoice_sender` text COMMENT '订单发票Sender配置',
  `advt_delay_days` smallint(3) NOT NULL DEFAULT '0' COMMENT '广告上传延迟天数',
  `advt_main_image_set` varchar(20) NOT NULL DEFAULT '' COMMENT '亚马逊主图设置',
  `is_open_lowprice` tinyint(1) unsigned zerofill NOT NULL DEFAULT '0' COMMENT '是否开启跟卖价:  1 . 开启  0 .不开启',
  `ac_id_title` varchar(300) NOT NULL DEFAULT '' COMMENT '亚马逊标题设置',
  `is_allow_repeat` tinyint(1) NOT NULL DEFAULT '0' COMMENT '亚马逊标题重复设置',
  `user_id` int(11) DEFAULT '0' COMMENT '销售负责人',
  `is_custom_temp` tinyint(2) NOT NULL DEFAULT '0' COMMENT 'invoice类型 0默认 1自定义',
  `ac_site_limit` varchar(255) NOT NULL COMMENT '新账号限制配置',
  `is_allow_transfer` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否允许迁移（0:否1:是）',
  `describe_position` tinyint(1) NOT NULL DEFAULT '0' COMMENT '插入描述位置（默认:0,1：描述后,2:描述前）',
  `describe_text` varchar(500) NOT NULL DEFAULT '' COMMENT '广告描述文本',
  `sort_describe_model_config` varchar(20) NOT NULL DEFAULT '' COMMENT '短描述的模板配置\r\nA：Description从上到下全部获取，有几行就取几行；\r\nB: 获取Description前面的4行， 加上 Package Includes 后面的内容；\r\nC：获取Specification后面的内容， 外加2行 Description前面2行；\r\nD: Description全部获取， 随机调换顺序出；\r\nE：Description全部获取， 前面加个 * 的标记， 随机调换顺序出',
  `manual_withdrawals` tinyint(2) DEFAULT '1' COMMENT '是否可以手动提款  1：是；2：否',
  `transfer_cycle` int(3) DEFAULT '0' COMMENT '转款周期',
  `transfer_status` tinyint(2) DEFAULT '1' COMMENT '转款状态  1：正常；2：受限',
  `is_auto_create` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否自动添加补广告产品',
  `product_live_days` smallint(6) NOT NULL DEFAULT '0' COMMENT '账号管理专员可上传对应live天数以上的产品广告',
  `is_brand_record` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否品牌备案：0：否，1：是',
  PRIMARY KEY (`ac_id`),
  UNIQUE KEY `site_code` (`site_code`),
  KEY `merchant_alias` (`merchant_alias`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `amazon_config` */

